type Greetprops={
    name:string;
    count:number;
    isLogin:boolean;
}


export const Greet=(props:Greetprops)=>{
    return(
        <div>
            <h1>{props.isLogin?`Greetings from {props.name} for you today {props.count}`:'Not Login'}</h1>
        </div>
    )

}
